.loadTxcss {
	padding-top: 150px;
}

.loadList {
	position: fixed !important;
	top: 95px;
	width: 100%;
	z-index: 4;
}

.loadingText {
	font-size: 15px;
	text-align: center;
	line-height: 30px;
	opacity: 0.9;
	transform: scale(1);
	padding-top: 10px;
}

.step2 {
	color: #fb131e;
	animation: big 1s infinite;
}

@keyframes big {
	0 {

		transform: scale(1);
	}

	50% {

		transform: scale(1.2);
	}

	100% {

		transform: scale(1);
	}
}

.alert {
	position: fixed;
	width: 100%;
	height: 100%;
	background: rgba(0, 0, 0, 0.6);
	z-index: 6;
	left: 0;
	top: 0;
	margin: auto;

	img {
		width: 200px;
		position: fixed;
		height: 150px;
		z-index: 7;
		left: 0;
		top: 0;
		margin: auto;
		right: 0;
		bottom: 0
	}
}

.loading {
	width: 90%;
	height: 45px;
	background-size: 100% 100%;
	margin: 10px 5% 10px 5%;
	position: relative;

	.index {
		width: 0%;
		position: absolute;
		height: 17px;
		top: 14px;
		background: #2880e8;
		left: 1%;
		border-radius: 20px 0px 0px 20px;
		transition: 4s linear;
	}


	.redBag {
		width: 38px;
		position: absolute;
		right: 0;
		bottom: 5px
	}

	.gif {
		bottom: 50px;
		width: 40px;
		position: absolute;
		right: -10px;

	}

	.qipao {
		animation: gif 1s infinite;
	}


}

@keyframes gif {
	0 {
		bottom: 50px
	}

	50% {
		bottom: 55px;
	}

	100% {
		bottom: 50px
	}
}
